	<style>svg#freepik_stories-celebration:not(.animated) .animable {
        opacity: 0;
    }

    svg#freepik_stories-celebration.animated #freepik--background-simple--inject-263 {
        animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideUp;
        animation-delay: 0s;
    }

    svg#freepik_stories-celebration.animated #freepik--Frames--inject-263 {
        animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedRight;
        animation-delay: 0s;
    }

    svg#freepik_stories-celebration.animated #freepik--Desk--inject-263 {
        animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) zoomOut, 1.5s Infinite linear wind;
        animation-delay: 0s, 1s;
    }

    svg#freepik_stories-celebration.animated #freepik--Plants--inject-263 {
        animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedRight;
        animation-delay: 0s;
    }

    svg#freepik_stories-celebration.animated #freepik--character-4--inject-263 {
        animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) zoomOut;
        animation-delay: 0s;
    }

    svg#freepik_stories-celebration.animated #freepik--character-3--inject-263 {
        animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideDown;
        animation-delay: 0s;
    }

    svg#freepik_stories-celebration.animated #freepik--character-2--inject-263 {
        animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedLeft;
        animation-delay: 0s;
    }

    svg#freepik_stories-celebration.animated #freepik--character-1--inject-263 {
        animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideUp;
        animation-delay: 0s;
    }

    @keyframes slideUp {
        0% {
            opacity: 0;
            transform: translateY(30px);
        }
        100% {
            opacity: 1;
            transform: inherit;
        }
    }

    @keyframes lightSpeedRight {
        from {
            transform: translate3d(50%, 0, 0) skewX(-20deg);
            opacity: 0;
        }
        60% {
            transform: skewX(10deg);
            opacity: 1;
        }
        80% {
            transform: skewX(-2deg);
        }
        to {
            opacity: 1;
            transform: translate3d(0, 0, 0);
        }
    }

    @keyframes zoomOut {
        0% {
            opacity: 0;
            transform: scale(1.5);
        }
        100% {
            opacity: 1;
            transform: scale(1);
        }
    }

    @keyframes wind {
        0% {
            transform: rotate(0deg);
        }
        25% {
            transform: rotate(1deg);
        }
        75% {
            transform: rotate(-1deg);
        }
    }

    @keyframes slideDown {
        0% {
            opacity: 0;
            transform: translateY(-30px);
        }
        100% {
            opacity: 1;
            transform: translateY(0);
        }
    }

    @keyframes lightSpeedLeft {
        from {
            transform: translate3d(-50%, 0, 0) skewX(20deg);
            opacity: 0;
        }
        60% {
            transform: skewX(-10deg);
            opacity: 1;
        }
        80% {
            transform: skewX(2deg);
        }
        to {
            opacity: 1;
            transform: translate3d(0, 0, 0);
        }
    }        </style>
